import React from 'react';
import '../styles/components.css';

const Experience: React.FC = () => {
    const experiences = [
        {
            title: 'Frontend Developer',
            company: 'Tech Company A',
            duration: 'Jan 2020 - Present',
            description: 'Developed user-friendly web applications using React and TypeScript.'
        },
        {
            title: 'Web Developer Intern',
            company: 'Startup B',
            duration: 'Jun 2019 - Dec 2019',
            description: 'Assisted in building responsive websites and improving user experience.'
        },
        {
            title: 'Freelance Developer',
            company: 'Self-Employed',
            duration: 'Jan 2018 - May 2019',
            description: 'Worked on various projects, including e-commerce sites and personal portfolios.'
        }
    ];

    return (
        <section className="experience">
            <h2>Experience</h2>
            <ul>
                {experiences.map((exp, index) => (
                    <li key={index}>
                        <h3>{exp.title}</h3>
                        <p><strong>{exp.company}</strong> | {exp.duration}</p>
                        <p>{exp.description}</p>
                    </li>
                ))}
            </ul>
        </section>
    );
};

export default Experience;
